import React from 'react';
import './nav-bar.styles.css';

const NavBar = () => {
  return(
    <div className='container'>
      <div className='options'>
        <p className='option' >
          Sign-in
        </p>
        <p className='option' >
          Sing-Up
        </p>
      </div>
    </div>
  )   
};

export default NavBar;
